import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "../styles/Profile.css";

const ProfileEdit = () => {
  const navigate = useNavigate();
  const [profile, setProfile] = useState({
    instruments: "",
    genres: "",
    influences: "",
    city: "",
    bio: "",
    yearsOfExperience: "",
    youtubeLink: "",
    instaLink: "",
  });

  useEffect(() => {
    const getProfile = async () => {
      try {
        const token = localStorage.getItem("token");
        const response = await axios.get("http://localhost:5000/api/profile", {
          headers: { Authorization: `Bearer ${token}` },
        });

        if (response.data) {
          setProfile({
            instruments: response.data.instruments?.join(", ") || "",
            genres: response.data.genres?.join(", ") || "",
            influences: response.data.influences?.join(", ") || "",
            city: response.data.city || "",
            bio: response.data.bio || "",
            yearsOfExperience: response.data.yearsOfExperience || "",
            youtubeLink: response.data.socialLinks?.youtube || "",
            instaLink: response.data.socialLinks?.instagram || "",
          });
        }
      } catch (error) {
        console.error("Error fetching profile:", error);
      }
    };

    getProfile();
  }, []);

  const handleUpdate = async () => {
    try {
      const token = localStorage.getItem("token");

      const response = await axios.put("http://localhost:5000/api/profile", {
        instruments: profile.instruments.split(",").map(item => item.trim()),
        genres: profile.genres.split(",").map(item => item.trim()),
        influences: profile.influences.split(",").map(item => item.trim()),
        city: profile.city,
        bio: profile.bio,
        yearsOfExperience: Number(profile.yearsOfExperience),
        socialLinks: {
          youtube: profile.youtubeLink,
          instagram: profile.instaLink,
        },
      }, {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (response.data) {
        alert("Profile updated successfully!");
        navigate("/profile");
      }
    } catch (error) {
      alert("Something went wrong while updating your profile.");
      console.error("Update Error:", error);
    }
  };

  return (
    <div className="profile-container">
      <div className="profile-card edit-profile">
        <h2 className="profile-title">EDIT PROFILE</h2>
        <div className="profile-form">
          <input type="text" placeholder="Instruments (comma separated)" value={profile.instruments} onChange={(e) => setProfile({ ...profile, instruments: e.target.value })} />
          <input type="text" placeholder="Genres (comma separated)" value={profile.genres} onChange={(e) => setProfile({ ...profile, genres: e.target.value })} />
          <input type="number" placeholder="Years of Experience" value={profile.yearsOfExperience} onChange={(e) => setProfile({ ...profile, yearsOfExperience: e.target.value })} />
          <input type="text" placeholder="Influences (comma separated)" value={profile.influences} onChange={(e) => setProfile({ ...profile, influences: e.target.value })} />
          <input type="text" placeholder="City" value={profile.city} onChange={(e) => setProfile({ ...profile, city: e.target.value })} />
          <textarea placeholder="Bio" rows="4" value={profile.bio} onChange={(e) => setProfile({ ...profile, bio: e.target.value })}></textarea>
          <input type="text" placeholder="Youtube Link" value={profile.youtubeLink} onChange={(e) => setProfile({ ...profile, youtubeLink: e.target.value })} />
          <input type="text" placeholder="Instagram Link" value={profile.instaLink} onChange={(e) => setProfile({ ...profile, instaLink: e.target.value })} />
        </div>
        <div className="button-group">
          <button className="cancel-btn" onClick={() => navigate("/profile")}>Back</button>
          <button className="update-btn" onClick={handleUpdate}>Update My Profile</button>
        </div>
      </div>
    </div>
  );
};

export default ProfileEdit;
